import { Component, Vue } from 'vue-property-decorator';

@Component({

})
export default class DataPage extends Vue {
    public $http:any;
    private list:string[]=[];
    async mounted(){
        let result  = await this.$http.get("./mockup_data/data1.json");
        console.log(result.data.list);
        this.list = result.data.list;
    }

}
